    return (
        <div style={{ display: 'flex', flexDirection: 'row', gap: 24, alignItems: 'center' }}>
            <div style={{ color: '#808080', fontSize: 20, fontWeight: 700 }}>이름</div>
            <div>
                <input type="text" placeholder="커뮤니티 이름을 입력해주세요" style={{ width: 900, height: 40, paddingLeft: 16, borderRadius: 8, borderStyle: 'solid', borderColor: '#B6B6B6' }} />
            </div>
        </div>
    )
}

export default inputfield;
